import React from 'react';
import ReactDOM from 'react-dom';

import Cards from "./Cards";
import './index.css';
import Sdata from './Sdata';

function Nweberies(val){
  return(
    <Cards 
    crdimg = {val.simgsrc}
    title= {val.stitle}
    category= {val.scategory} 
    link= {val.slink} 
    />
  )

}

function App(){
    return (
        <React.Fragment>        
        <h1 className='heading_style'>The Top 5 Netflix Weberies</h1>
        {Sdata.map(Nweberies)}
      </React.Fragment>
    )
}

export default App;
